import Vue from 'vue'
import VueRouter from 'vue-router'
import IndexPage from '@/views/indexPage.vue'

Vue.use(VueRouter)


const routes = [
    {
        path: '/',
        name: 'index',
        component: IndexPage
    }
]

const router = new VueRouter({
    routes
})

export default router
